import React from 'react';
import HmDash from './Hm/Main';
import 'moment/locale/fr';
import moment from 'moment';
import './Loading.css';

// Return Home Admin
function App() {

 React.useEffect(() => {
  window.console.log(moment().isSame(moment().startOf('hour')))
 }, [])

 return (
  <HmDash />
 );
};

// Export component Main 
export default App;
